import React, { useState, useEffect } from 'react';
import axios from 'axios';



const Servicesss = () => {
  const [order, setProducts] = useState([]);
useEffect(() => {
  fetchProducts();
}, []);
const fetchProducts = () => {
  axios
    .get('http://localhost:8082/admin/allpacks')
    .then((res) => {
      console.log(res);
      setProducts(res.data);
    })
    .catch((err) => {
      console.log(err);
    });
};

return (
  <div className='bg'>
  <h1>Wash packs</h1>
  <div className='item-container'>
    {order.map((order) => (
      <div className='card' key={order.id} >
        <h3>Id:{order._id}</h3>
        <h3>NAME: {order.name}</h3>
        <h3>COST: {order.cost} rupees</h3>
        <h3>DESCRIPTION: {order.description} </h3>
        
        <button className="bookBtn" >ORDERNOW <i className="fas fa-arrow-right rightArw"></i></button>
      </div>
    ))}
  </div>
</div>
  );
};
export default Servicesss;
